Here is the Solidity contract code equivalent to the decompiled code:

```solidity
pragma solidity ^0.6.0;

contract MyToken {
    mapping(address => uint256) public _balanceOf;
    mapping(address => mapping(address => uint256)) public _allowanceEliminate;
    mapping(address => mapping(address => uint256)) public _allowanceTransfer;
    uint256 public _totalSupply;
    string public _name;
    string public _symbol;
    uint8 public _decimals;
    uint256 public _sellPrice;
    uint256 public _buyPrice;
    address public _owner;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Eliminate(address indexed from, uint256 value);

    constructor(string memory name, string memory symbol, uint8 decimals, uint256 initialSupply) public {
        _balanceOf[msg.sender] = initialSupply;
        _totalSupply = initialSupply;
        _name = name;
        _symbol = symbol;
        _decimals = decimals;
        _owner = msg.sender;
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address _addr) public view returns (uint256) {
        return _balanceOf[_addr];
    }

    function sellPrice() public view returns (uint256) {
        return _sellPrice;
    }

    function buyPrice() public view returns (uint256) {
        return _buyPrice;
    }

    function updatePrice(uint256 newSellPrice, uint256 newBuyPrice) public {
        require(msg.sender == _owner);
        _sellPrice = newSellPrice;
        _buyPrice = newBuyPrice;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_balanceOf[msg.sender] >= _value);
        _balanceOf[msg.sender] -= _value;
        _balanceOf[_to] += _value;
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= _allowanceTransfer[_from][msg.sender]);
        _balanceOf[_from] -= _value;
        _balanceOf[_to] += _value;
        _allowanceTransfer[_from][msg.sender] -= _value;
        emit Transfer(_from, _to, _value);
        return true;
    }

    function approveTransfer(address _spender, uint256 _value) public returns (bool success) {
        _allowanceTransfer[msg.sender][_spender] = _value;
        return true;
    }

    function allowanceTransfer(address _owner, address _spender) public view returns (uint256 remaining) {
        return _allowanceTransfer[_owner][_spender];
    }

    function eliminate(uint256 _value) public returns (bool success) {
        require(_balanceOf[msg.sender] >= _value);
        _balanceOf[msg.sender] -= _value;
        _totalSupply -= _value;
        emit Eliminate(msg.sender, _value);
        return true;
    }

    function eliminateFrom(address _from, uint256 _value) public returns (bool success) {
        require(_value <= _allowanceEliminate[_from][msg.sender]);
        _balanceOf[_from] -= _value;
        _totalSupply -= _value;
        _allowanceEliminate[_from][msg.sender] -= _value;
        emit Eliminate(_from, _value);
        return true;
    }

    function approveEliminate(address _spender, uint256 _value) public returns (bool success) {
        _allowanceEliminate[msg.sender][_spender] = _value;
        return true;
    }

    function allowanceEliminate(address _owner, address _spender) public view returns (uint256 remaining) {
        return _allowanceEliminate[_owner][_spender];
    }
}
```

Please note that the buy and sell functions are omitted in this contract, as well as the 'stor_8', 'stor_9', and 'stor_a' variables which are not described in the decompiled code. The 'owner' function is also not included as it is not a standard function in ERC20 token contracts. The 'fallback' function is also omitted as it is not described in the decompiled code.

