}

function sellPrice() public nonPayable { 
    return _sellPrice;
}

function updatePrice() public nonPayable { 
    assert(_totalSupply);
    _sellPrice = stor_8 * stor_a / _totalSupply;
    assert(_totalSupply);
    _buyPrice = stor_9 * stor_a / _totalSupply;
}

function balanceOf(address varg0) public nonPayable { 
    return _balanceOf[varg0];
}

function buyPrice() public nonPayable { 
    return _buyPrice;
}

function approveEliminate(address varg0, uint256 varg1) public nonPayable { 
    _allowanceEliminate[varg0] = varg1;
    return 1;
}

function owner() public nonPayable { 
    return _owner;
}

function symbol() public nonPayable { 
    v0 = new bytes[](_symbol.length);
    v1 = v2 = v0.data;
    if (_symbol.length) {
        if (31 < _symbol.length) {
            do {
                MEM[v1] = STORAGE[v3];
                v3 += 1;
                v1 += 32;
            } while (v2 + _symbol.length <= v1);
        } else {
            MEM[v2] = _symbol.length >> 8 << 8;
        }
    }
    v4 = new array[](v0.length);
    v5 = v6 = 0;
    while (v5 < v0.length) {
        MEM[v5 + v4.data] = MEM[v0.data + v5];
        v5 += 32;
    }
    v7 = v8 = v0.length + v4.data;
    if (0x1f & v0.length) {
        MEM[v8 - (0x1f & v0.length)] = ~(256 ** (32 - (0x1f & v0.length)) - 1) & MEM[v8 - (0x1f & v0.length)];
    }
    return v4;
}

function buy() public payable { 
    assert(_buyPrice);
    0x8c4(1000 * msg.value / _buyPrice, msg.sender, this);
}

function transfer(address varg0, uint256 varg1) public nonPayable { 
    0x8c4(varg1, varg0, msg.sender);
}

function allowanceTransfer(address varg0, address varg1) public nonPayable { 
    return _allowanceTransfer[varg1];
}

function sell(uint256 varg0) public nonPayable { 
    require((address(this)).balance >= varg0 * _sellPrice / 1000);
    0x8c4(varg0, this, msg.sender);
    v0 = msg.sender.call().value(varg0 * _sellPrice / 1000).gas(!(varg0 * _sellPrice / 1000) * 2300);
    require(v0);
}

function transferOwnership(address varg0) public nonPayable { 
    require(_owner == msg.sender);
    _owner = varg0;
}

function approveTransfer(address varg0, uint256 varg1) public nonPayable { 
    _allowanceTransfer[varg0] = varg1;
    return 1;
}

function 0x8c4(uint256 varg0, uint256 varg1, uint256 varg2) private { 
    require(address(varg1));
    v0 = address(varg2);
    require(_balanceOf[v0] >= varg0);
    v1 = address(varg1);
    require(_balanceOf[v1] + varg0 > _balanceOf[v1]);
    v2 = address(varg1);
    v3 = address(varg2);
    _balanceOf[v3] = _balanceOf[v3] - varg0;
    _balanceOf[v2] += varg0;
    emit Transfer(v3, v2, varg0);
    v4 = address(varg1);
    v5 = address(varg2);
    assert(_balanceOf[v2] + _balanceOf[v3] == _balanceOf[v5] + _balanceOf[v4]);
    return ;
}

